import React, {useState} from "react";
import styles from './FilterButtons.module.css'

export const FilterButtons = (props) => {
    const [filterButtonSelected, setFilterButtonSelected] = useState("");
    const selectedButton = `selected-filter__button`;
   
    const clickHandler = (e) => {
        setFilterButtonSelected(prevState=> newState != prevState)
    }
  return (
    <div className={styles["filter-buttons__wrap"]}>
      <div onClick={clickHandler} id="All">All</div>
      <div id="IOS dev-s">IOS dev-s</div>
      <div id="Designers">Designers</div>
    </div>
  );
};
